INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (787, 1, 0, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 0, 0, 118501, 118501, 118501, 0, 37, 118501, "カリン", 450, "2030/12/31 15:00:00", 0, 1, 0, "かりん", 37, 0, 0, 2.0, 2, "2021/10/19 12:00:00");
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (826, 3, 0, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 0, 0, 118601, 118601, 118601, 0, 0, 118601, "ネビア", 450, "2030/12/31 15:00:00", 0, 1, 0, "ねびあ", 0, 0, 0, 2.0, 2, "2024/08/10 21:00:00");
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (714, 3, 0, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 0, 0, 119001, 119001, 119001, 0, 7, 119001, "イオ（ノワール）", 450, "2030/12/31 15:00:00", 0, 0, 0, "いお", 7, 0, 15, 2.27, 2, "2021/11/03 19:00:00");
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (143, 3, 0, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 0, 0, 119101, 119101, 119101, 0, 26, 119101, "クウカ（ノワール）", 450, "2030/12/31 15:00:00", 0, 0, 0, "くうか", 7, 0, 12, 2.545, 2, "2021/11/16 12:00:00");
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (397, 1, 0, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 0, 0, 119201, 119201, 119201, 0, 6, 119201, "マヒル（クリスマス）", 450, "2030/12/31 15:00:00", 0, 1, 0, "まひる", 6, 0, 5, 2.19, 1, "2023/09/19 15:00:00");
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (762, 3, 0, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", 0, 0, 119301, 119301, 119301, 0, 8, 119301, "リノ（クリスマス）", 450, "2030/12/31 15:00:00", 0, 0, 0, "りの", 8, 0, 6, 1.97, 1, "2021/12/22 12:00:00");
