INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (302, 3, 0, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 0, 0, 119901, 119901, 119901, 0, 1, 119901, "ミヤコ（クリスマス）", 450, "2024/12/31 11:59:59", 0, 1, 0, "みやこ", 1, 0, 14, 2.17, 1, "2024/12/22 12:00:00");
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (190, 3, 0, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 0, 0, 120001, 120001, 120001, 0, 5, 120001, "シズル（ノワール）", 450, "2025/03/15 14:59:59", 0, 1, 0, "しずる", 5, 0, 6, 2.375, 1, "2025/03/10 12:00:00");
